import './header.css'

function Header(props) {
    return (
        <div>
            <div className='livre1 center'>
            <h2>{props.title}</h2>
            <h2>{props.name}</h2>
            <h2>{props.date}</h2>
            <h2>{props.note}</h2>
            <img src={require(`../../assets/${props.img}`)} className='img' ></img> 
            </div>
        </div>
    )
}

export default Header;
